    for(uint i=0; i < n;i++){
        if(getInstanceBuyerAddress(i)==indexadd){
            ArrID[i]=i+1;}
    }
    return ArrID;
  }
  
  
  function getPropFromSeller(address indexadd) public view returns (uint[] memory ) {
